#include "cutie.h"

static unsigned long long int ft_strlen( volatile const char *str)
{
	unsigned long long int i= 0;
	while (str[i])
		++i;
	return (i);
}

static void display_long(void)
{
	TOGGLE(PORTB, D1);
	_delay_ms(500);
	TOGGLE(PORTB, D1);
	_delay_ms(250);
}
static void display_short(void)
{
	TOGGLE(PORTB, D1);
	_delay_ms(500);
	TOGGLE(PORTB, D1);
	_delay_ms(250);
}
void display_ok( void )
{
	display_long();
	display_long();
	display_long();
	display_long();
	display_short();
	display_long();
}

void erase_n_characters(unsigned long long int n)
{
	while (n--)
		uart_txt_erase_char();	
}

void erase_entire_string(const char *str)
{
	erase_n_characters(ft_strlen(str));
}

void	go_back_n_times(unsigned long long int n)
{
	while (n--)
		uart_tx(8);
}

void	go_back_entire_string(const char *str)
{
	go_back_n_times( ft_strlen(str));
}

void	display_frame(char *frame_begin, char *frame_end)
{
	uart_printstr(frame_begin);
	_delay_ms(1);
	uart_printstr(frame_end);
	_delay_ms(DELAY);
	go_back_n_times(2000);
}


